import React from "react";
import classes from "./Movie.module.css";
import Rating from "./Rating/Rating";
const movie = (props) => {
  // const myClassname = props.className;
  let myClasses = null;
  myClasses = props.classes;
  // const myClasses = props.classes;
  // classes = myClasses;
  return (
    <div className={myClasses.movie_card}>
      <div className={myClasses.movie_header}>
        <div className={myClasses.info_section}>
          <h1>{props.title}</h1>
        </div>
        <div>
          <img className={myClasses.Images} src={props.image} alt="Movie" />
        </div>
        <div className={myClasses.rating}>
          <Rating name={props.name} rating={props.rating} />
        </div>
      </div>
      <div className={myClasses.movie_desc}>
        <p style={{ padding: "8px" }}>{props.description}</p>
      </div>
    </div>
  );
};

export default movie;
